sympy.sympy.core._print_helpers.__str__:
def __str__(self):
    from sympy.printing.str import sstr
    return sstr(self, order=None)

sympy.sympy.polys.polyclasses.to_sympy_d:
def to_sympy_dict(f, zero: bool = False) -> dict[monom, Expr]:
    """Convert ``f`` to a dict representation with SymPy coefficients. """
    to_sympy = f.dom.to_sympy
    return {k: to_sympy(v) for k, v in f.to_dict(zero=zero).items()}

sympy.sympy.polys.polyutils.expr_from_di:
def expr_from_dict(rep, *gens):
    """Convert a multinomial form into an expression. """
    result = []

    for monom, coeff in rep.items():
        term = [coeff]
        for g, m in zip(gens, monom):
            if m:
                term.append(Pow(g, m))

        result.append(Mul(*term))

    return Add(*result)
